import Style from "../components/Style/Style";
import Head from "next/head";

export default function Index() {
  return (
    <div>
      <Head>
        <title>It just works</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>
      <Menu />
      <Style>
        <h1>memes</h1>
        <p>meems</p>
      </Style>
    </div>
  );
}
